import React, {useEffect, useState, useRef} from "react";

function usePrevious(value) {
  const ref = useRef();
  useEffect(() => {
    ref.current = value;
  });
  return ref.current;
}

function SidaSammanlagdStats({patienter}) {
  const [currentAntalPatienter, setCurrentAntalPatienter] = useState(0);
  const prevAntalPatienterRef = useRef(0);

  useEffect(() => {
    prevAntalPatienterRef.current = currentAntalPatienter;
  }, [currentAntalPatienter]);

  useEffect(() => {
    setCurrentAntalPatienter(patienter.length);
  }, [patienter]);

  const okaAntal =
    currentAntalPatienter > prevAntalPatienterRef.current
      ? prevAntalPatienterRef.current + 1
      : prevAntalPatienterRef.current;

  return (
    <>
      <div className="tittel">
        <h1>Statistik filtrerad</h1>
      </div>
      <p>inskrivna: {okaAntal}</p>
    </>
  );
}

export default SidaSammanlagdStats;
